                                ["custom"] = "function(allstates, event, ...)\
           if event == \"LIQUID_CUSTOM_EVENT\" then\
               local id, encounterStart = ...\
               \
               if id ~= aura_env.id then return end\
               if encounterStart ~= aura_env.encounterStart then return end\
               \
               allstates[\"\"] = {\
                   show = true,\
                   changed = true,\
                   progressType = \"timed\",\
                   duration = 5,\
                   expirationTime = GetTime() + 5,\
                   autoHide = true\
               }\
               \
               return true\
           elseif event == \"UNIT_SPELLCAST_SUCCEEDED\" then\
               local _, castGUID, spellID = ...\
               \
               if not aura_env.active then return end\
               if not castGUID then return end\
               \
               if spellID == 442530 then -- Bloodcurdle\
                   C_Timer.After(11, function() WeakAuras.ScanEvents(\"LIQUID_CUSTOM_EVENT\", aura_env.id, aura_env.encounterStart) end)\
                   C_Timer.After(43, function() WeakAuras.ScanEvents(\"LIQUID_CUSTOM_EVENT\", aura_env.id, aura_env.encounterStart) end)\
                   C_Timer.After(70, function() WeakAuras.ScanEvents(\"LIQUID_CUSTOM_EVENT\", aura_env.id, aura_env.encounterStart) end)\
                   C_Timer.After(102, function() WeakAuras.ScanEvents(\"LIQUID_CUSTOM_EVENT\", aura_env.id, aura_env.encounterStart) end)\
               end\
           elseif event == \"ENCOUNTER_START\" then\
               local _, _, difficultyID = ...\
               \
               aura_env.active = false\
               aura_env.encounterStart = GetTime()\
               \
               if difficultyID == 16 then return end\
               \
               if (C_AddOns.IsAddOnLoaded(\"ExRT\") or C_AddOns.IsAddOnLoaded(\"MRT\")) and _G.VExRT.Note.Text1 then\
