                                ["custom"] = "function(allstates, event, ...)\
           if event == \"OPTIONS\" then\
               allstates[\"\"] = {\
                   show = true,\
                   changed = true,\
                   assignment = math.random(2)\
               }\
           elseif event == \"LIQUID_SIKRAN_DECIMATE\" then\
               local id, GUID = ...\
               \
               if id ~= aura_env.id then return end\
               \
               tInsertUnique(aura_env.affected, GUID)\
               \
               if #aura_env.affected == 2 then\
                   LiquidWeakAuras:SortTable(aura_env.affected)\
                   \
                   local assignment = tIndexOf(aura_env.affected, WeakAuras.myGUID)\
                   \
                   if assignment then\
                       allstates[\"\"] = {\
                           show = true,\
                           changed = true,\
                           assignment = assignment\
                       }\
                       \
                       return true\
                   end\
               end\
           elseif event == \"RAID_BOSS_WHISPER\" then\
               local text = ...\
               \
               if text:match(\"spell:459349\") then\
                   LiquidWeakAuras:Broadcast(\"LIQUID_SIKRAN_DECIMATE\", aura_env.id, WeakAuras.myGUID)\
               end\
           elseif event == \"UNIT_SPELLCAST_SUCCEEDED\" then\
               local _, castGUID, spellID = ...\
               \
               if not castGUID then return end\
               \
               if spellID == 442428 then -- Decimate\
                   aura_env.affected = {}\
                   \
                   for _, state in pairs(allstates) do\
                       state.show = false\
                       state.changed = true\
                   end\
                   \
                   return true\
               end\
           elseif event == \"ENCOUNTER_START\" then\
               aura_env.affected = {}\
           end\
       end",
