               elseif subEvent == \"SPELL_AURA_APPLIED\" and spellID == 434860 then -- Phase Blades (bleed)\
                   -- If the target is a (dark iron) dwarf and has their racial available, they are assigned to use it\
                   local stoneformInfo = LiquidAPI:GetCooldownBySpellID(destGUID, 20594)\
                   local firebloodInfo = LiquidAPI:GetCooldownBySpellID(destGUID, 265221)\
                   \
                   if stoneformInfo and stoneformInfo.available or firebloodInfo and firebloodInfo.available then\
                       if destGUID == WeakAuras.myGUID then\
                           allstates[\"\"] = {\
                               show = true,\
                               changed = true,\
                               progressType = \"timed\",\
                               duration = 20,\
                               expirationTime = GetTime() + 20,\
                               assignment = \"Stoneform bleed\",\
                               GUID = destGUID,\
                               autoHide = true\
                           }\
                       end\
                       \
                       return true\
                   end\
                   \
                   if aura_env.phaseBladesCount ~= 2 then return end\
                   \
                   -- Loop through evokers in order\
                   -- The first evoker that has not yet been assigned, and has Cauterizing Flame available gets assigned to dispel\
                   for _, GUID in ipairs(aura_env.evokers) do\
                       if not aura_env.assignedEvokers[GUID] then\
                           local cauterizingFlameInfo = LiquidAPI:GetCooldownBySpellID(GUID, 374251)\
                           \
                           if cauterizingFlameInfo and cauterizingFlameInfo.available then\
                               aura_env.assignedEvokers[GUID] = true\
                               \
                               if GUID == WeakAuras.myGUID then\
                                   local unit = aura_env.GUIDToUnit[destGUID]\
                                   \
                                   allstates[\"\"] = {\
                                       show = true,\
                                       changed = true,\
                                       progressType = \"timed\",\
                                       duration = 20,\
                                       expirationTime = GetTime() + 20,\
                                       assignment = string.format(\"Dispel %s\", WA_ClassColorName(unit)),\
                                       GUID = destGUID,\
                                       unit = unit,\
                                       autoHide = true\
                                   }\
                               end\
                               \
                               return true\
                           end\
                       end\
                   end\
               elseif subEvent == \"SPELL_AURA_REMOVED\" and spellID == 434860 then -- Phase Blades (bleed)\
                   local state = allstates[\"\"]\
                   \
                   if state and state.GUID == destGUID then\
                       state.show = false\
                       state.changed = true\
                       \
                       return true\
                   end\
               end\
           elseif event == \"ENCOUNTER_START\" then\
               aura_env.phaseBladesCount = 0\
               aura_env.evokers = {}\
               aura_env.assignedEvokers = {}\
               aura_env.GUIDToUnit = {}\
               \
               for unit in WA_IterateGroupMembers() do\
                   local GUID = UnitGUID(unit)\
                   \
                   aura_env.GUIDToUnit[GUID] = unit\
                   \
                   if UnitClassBase(unit) == \"EVOKER\" then\
                       table.insert(aura_env.evokers, GUID)\
                   end\
               end\
               \
               table.sort(aura_env.evokers)\
           end\
       end",
