                                ["custom"] = "function(allstates, event, ...)\
           if event == \"OPTIONS\" then\
               allstates[\"\"] = {\
                   show = true,\
                   changed = true,\
                   mark = string.format(\"{rt%d}\", math.random(4)),\
                   unit = \"player\"\
               }\
           elseif event == \"LIQUID_BROODTWISTER_EXPERIMENTAL_DOSAGE\" then\
               local assignments, duration = ...\
               \
               for i, GUID in ipairs(assignments) do\
                   local assignment = aura_env.assignments[i]\
                   local unit = aura_env.GUIDToUnit[GUID]\
                   \
                   allstates[GUID] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"timed\",\
                       duration = duration,\
                       expirationTime = GetTime() + duration,\
                       mark = string.format(\"{rt%d}\", assignment),\
                       unit = unit,\
                       autoHide = true\
                   }\
               end\
               \
               return true\
           elseif event == \"ENCOUNTER_START\" then\
               local _, _, difficultyID = ...\
               \
               aura_env.GUIDToUnit = {}\
               \
               for unit in WA_IterateGroupMembers() do\
                   aura_env.GUIDToUnit[UnitGUID(unit)] = unit\
               end\
               \
               if difficultyID == 16 then -- Mythic\
                   aura_env.assignments = {\
                       1, 1, 2, 2, 3, 3, 4, 4\
                   }\
               else\
                   aura_env.assignments = {\
                       1, 2, 3, 4\
                   }\
               end\
           end\
       end",
