               if subEvent == \"SPELL_CAST_SUCCESS\" then\
                   if spellID == 437620 then -- Nether Rift\
                       aura_env.queensbaneCount = 0\
                       aura_env.setCount = aura_env.setCount + 1\
                   elseif spellID == 435405 then -- Starless Night\
                       aura_env.setCount = 1\
