                    ["customSort"] = "function(a, b)\
           if a.dataIndex ~= b.dataIndex then\
               return a.dataIndex <= b.dataIndex\
           else\
               if not (a.region and a.region.state) then return false end\
               if not (b.region and b.region.state) then return true end\
               \
               local stateA = a.region.state\
               local stateB = b.region.state\
               \
               if stateA.index ~= stateB.index then\
                   return stateA.index < stateB.index\
               elseif stateA.stacks ~= stateB.stacks then -- Sort by stacks\
                   return (stateA.stacks or 0) > (stateB.stacks or 0)\
               elseif stateA.role ~= stateB.role then -- Sort by role\
                   return (stateA.role or 0) > (stateB.role or 0)\
               elseif stateA.unit ~= stateB.unit then\
                   if not stateA.unit then return false end\
                   if not stateB.unit then return true end\
                   \
                   local classA = UnitClassBase(stateA.unit)\
                   local classB = UnitClassBase(stateB.unit)\
                   \
                   if classA ~= classB then -- Sort by class\
                       return classA < classB\
                   else\
                       local nameA = UnitName(stateA.unit)\
                       local nameB = UnitName(stateB.unit)\
                       \
                       if nameA ~= nameB then -- Sort by name\
                           return nameA < nameB\
                       end\
                   end\
               elseif stateA.GUID ~= stateB.GUID then -- Sort by GUID\
                   return (stateA.GUID or 0) < (stateB.GUID or 0)\
               else -- Sort by expiration time\
                   return (a.region.state.expirationTime or 0) > (b.region.state.expirationTime or 0)\
               end\
           end\
       end",
