                    ["customText"] = "function()\
           if WeakAuras.IsOptionsOpen() then\
               local name = LiquidAPI and LiquidAPI:GetName(\"player\") or UnitName(\"player\")\
               \
               local _, randomClass1 = GetClassInfo(math.random(13))\
               local _, randomClass2 = GetClassInfo(math.random(13))\
               \
               local colorStr1 = RAID_CLASS_COLORS[randomClass1].colorStr\
               local colorStr2 = RAID_CLASS_COLORS[randomClass2].colorStr\
               \
               local coloredName1 = string.format(\"|c%s%s\", colorStr1, name)\
               local coloredName2 = string.format(\"|c%s%s\", colorStr2, name)\
               \
               return coloredName1, coloredName2\
           end\
           \
           local name1 = WA_ClassColorName(aura_env.state.unit1)\
           local name2 = WA_ClassColorName(aura_env.state.unit2)\
           \
           -- Set nicknames (if available)\
           if aura_env.state.unit1 then\
               local nickname = LiquidAPI and LiquidAPI:GetName(aura_env.state.unit1)\
               \
               if nickname then\
                   local classFileName = UnitClassBase(aura_env.state.unit1)\
