                                ["custom"] = "function(allstates, event, ...)\
           if event == \"OPTIONS\" then\
               for i = 1, 10 do\
                   local debuffColor1 = math.random(2) == 1 and \"BLUE\" or \"RED\"\
                   local debuffColor2 = math.random(2) == 1 and \"BLUE\" or \"RED\"\
                   \
                   local index = 0\
                   \
                   if debuffColor1 == debuffColor2 then\
                       if debuffColor1 == \"RED\" then\
                           index = 2\
                       elseif debuffColor1 == \"BLUE\" then\
                           index = 1\
                       end\
                   end\
                   \
                   allstates[i] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"static\",\
                       value = 0.5,\
                       total = 1,\
                       unit1 = \"player\",\
                       unit2 = \"player\",\
                       debuffColor1 = debuffColor1,\
                       debuffColor2 = debuffColor2,\
                       index = index\
                   }\
               end\
           elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\
               local _, subEvent, _, _, _, _, _, destGUID, _, _, _, spellID = ...\
               \
               if spellID == 440001 then -- Binding Webs\
                   if subEvent == \"SPELL_AURA_APPLIED\" then\
                       local unit = aura_env.GUIDToUnit[destGUID]\
                       local sourceUnit = select(7, WA_GetUnitDebuff(unit, 440001))\
                       \
                       if not sourceUnit then return end\
                       \
                       local sourceGUID = UnitGUID(sourceUnit)\
                       \
                       -- Check if this state already exists in a different order (if so, don't create it)\
                       for _, state in pairs(allstates) do\
                           if state.GUID1 == destGUID and state.GUID2 == sourceGUID then\
                               return\
                           end\
                       end\
                       \
                       local unit1 = aura_env.GUIDToUnit[sourceGUID]\
                       local unit2 = aura_env.GUIDToUnit[destGUID]\
                       \
                       local index = 0\
                       local debuffColor1, debuffColor2\
                       \
                       -- In mythic, sort based on color\
                       if aura_env.isMythic then\
                           debuffColor1 = WA_GetUnitDebuff(unit1, 455849) and \"BLUE\" or WA_GetUnitDebuff(unit1, 455850) and \"RED\" -- Mark of Paranoia/Mark of Rage\
                           debuffColor2 = WA_GetUnitDebuff(unit2, 455849) and \"BLUE\" or WA_GetUnitDebuff(unit2, 455850) and \"RED\"\
                           \
                           if debuffColor1 == debuffColor2 then\
                               if debuffColor1 == \"RED\" then\
                                   index = 2\
                               elseif debuffColor1 == \"BLUE\" then\
                                   index = 1\
                               end\
                           end\
                       else -- In heroic, sort based on melee/ranged\
                           local position1 = LiquidWeakAuras:Spec(unit1)\
                           local position2 = LiquidWeakAuras:Spec(unit2)\
                           \
                           local index1 = position1 == \"r\" and 0 or 10\
                           local index2 = position2 == \"r\" and 0 or 10\
                           \
                           index = index1 + index2\
                       end\
                       \
                       \
                       allstates[sourceGUID] = {\
                           show = true,\
                           changed = true,\
                           progressType = \"static\",\
                           value = 0.5,\
                           total = 1,\
                           GUID1 = sourceGUID,\
                           GUID2 = destGUID,\
                           unit1 = unit1,\
                           unit2 = unit2,\
                           debuffColor1 = debuffColor1,\
                           debuffColor2 = debuffColor2,\
                           index = index\
                       }\
                       \
                       return true\
                   elseif subEvent == \"SPELL_AURA_REMOVED\" then\
                       for _, state in pairs(allstates) do\
                           if state.GUID1 == destGUID or state.GUID2 == destGUID then\
                               state.show = false\
                               state.changed = true\
                           end\
                       end\
                       \
                       return true -- Can be inside the loop, just having it here for safety in case the assumption that only one of the two players has a source on their debuff is false\
                   end\
               end\
           elseif event == \"ENCOUNTER_START\" then\
               local _, _, difficultyID = ...\
               \
               aura_env.isMythic = difficultyID == 16\
               aura_env.GUIDToUnit = {}\
               \
               for unit in WA_IterateGroupMembers() do\
                   aura_env.GUIDToUnit[UnitGUID(unit)] = unit\
               end\
           end\
       end",
