                    ["customText"] = "function()\
           return WA_ClassColorName(aura_env.state.unit), aura_env.state.isWebbed and CreateTextureMarkup(5764932, 64, 64, 0, 0, 5/64, 59/64, 5/64, 59/64) or \"\"\
