                                ["names"] = {
                                },
                                ["custom"] = "function(allstates, event, ...)\
           if event == \"OPTIONS\" then\
               allstates[1] = {\
                   show = true,\
                   changed = true,\
                   unit = \"player\",\
                   assignment = math.random(5)\
               }\
           elseif event == \"LIQUID_SILKEN_COURT_DISPEL_ORDER\" then\
               local _, initialAffected, affected = ...\
               \
               for _, state in pairs(allstates) do\
                   state.show = false\
                   state.changed = true\
               end\
               \
               local dispelsDone = 5 - #initialAffected\
               \
               for i, GUID in ipairs(initialAffected) do\
                   allstates[GUID] = {\
                       show = true,\
                       changed = true,\
                       unit = aura_env.GUIDToUnit[GUID],\
                       assignment = dispelsDone + i\
                   }\
               end\
               \
               for i, GUID in ipairs(affected) do\
                   allstates[GUID] = {\
                       show = true,\
                       changed = true,\
                       unit = aura_env.GUIDToUnit[GUID],\
                       assignment = #initialAffected + dispelsDone + i\
                   }\
               end\
               \
               return true\
           elseif event == \"ENCOUNTER_START\" then\
               aura_env.GUIDToUnit = {}\
               \
               for unit in WA_IterateGroupMembers() do\
                   aura_env.GUIDToUnit[UnitGUID(unit)] = unit\
               end\
               \
               for _, state in pairs(allstates) do\
                   state.show = false\
                   state.changed = true\
               end\
               \
               return true\
           end\
       end",
