               for i = 2, 5 do\
                   allstates[i] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"static\",\
                       value = 1,\
                       total = 1,\
                       unit = \"player\",\
                       mark = string.format(\"{rt%d}\", i),\
                       index = i,\
                       icon = 2115303,\
                       popped = false,\
                       autoHide = false\
                   }\
               end\
           elseif event == \"LIQUID_FROTH_POP_ASSIGNMENTS\" then\
               local poppers = ...\
               \
               if not poppers then return end\
               \
               for i, GUID in ipairs(poppers) do\
                   local unit = aura_env.GUIDToUnit[GUID]\
                   \
                   allstates[i] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"static\",\
                       value = 1,\
                       total = 1,\
                       unit = unit,\
                       mark = string.format(\"{rt%d}\", i),\
                       index = i,\
                       icon = 2115303,\
                       popped = false,\
                       autoHide = false\
                   }\
               end\
               \
               return true\
           elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\
               local _, subEvent, _, _, _, _, _, _, _, _, _, spellID = ...\
