               allstates[1] = {\
                   show = true,\
                   changed = true,\
                   progressType = \"static\",\
                   total = 1,\
                   value = 1,\
                   onFloor = true,\
                   count = math.random(4, 10),\
                   index = 100,\
                   icon = 4913234,\
                   autoHide = false\
               }\
               \
               --[[\
               for i = 1, 5 do\
                   allstates[1 + i] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"timed\",\
                       duration = 15,\
                       expirationTime = GetTime() + 15,\
                       onFloor = false,\
                       index = i,\
                       icon = 460857,\
                       unit = \"player\",\
                       autoHide = true\
                   }\
               end\
       ]]\
           elseif event == \"LIQUID_ACOLYTES_ESSENCE\" then\
               local carrying, onFloor = ...\
               \
               for _, state in pairs(allstates) do\
                   state.show = false\
                   state.changed = true\
               end\
               \
               if onFloor > 0 then\
                   allstates[1] = {\
                       show = true,\
                       changed = true,\
                       progressType = \"static\",\
                       total = 1,\
                       value = 1,\
                       onFloor = true,\
                       count = onFloor,\
                       index = 100,\
                       icon = 4913234,\
                       autoHide = false\
                   }\
               end\
               \
               --[[\
               for i, GUID in ipairs(carrying) do\
                   local unit = aura_env.GUIDToUnit[GUID]\
                   \
                   local _, _, _, _, duration, expirationTime = WA_GetUnitDebuff(unit, 445152) -- Acolyte's Essence\
                   \
                   if duration then\
                       allstates[1 + i] = {\
                           show = true,\
                           changed = true,\
                           progressType = \"timed\",\
                           duration = duration,\
                           expirationTime = expirationTime,\
                           onFloor = false,\
                           index = i,\
                           icon = 460857,\
                           unit = unit,\
                           autoHide = true\
                       }\
                   end\
               end\
       ]]\
               \
               return true\
           elseif event == \"ENCOUNTER_START\" then\
               aura_env.GUIDToUnit = {}\
               \
               for unit in WA_IterateGroupMembers() do\
                   aura_env.GUIDToUnit[UnitGUID(unit)] = unit\
               end\
           end\
       end",
