                       \
                       return\
                   end\
               end\
           elseif event == \"INSTANCE_ENCOUNTER_ENGAGE_UNIT\" then\
               for i = 1, 8 do\
                   local unit = \"boss\" .. i\
                   \
                   if not UnitExists(unit) then break end\
                   \
                   local GUID = UnitGUID(unit)\
                   local npcID = LiquidWeakAuras:CreatureInfo(GUID)\
